        smallHeaderShadow.shadowBlurRadius = 1
        
        
        //// Subframes
        let group: NSRect = NSRect(x: frame.minX + fastFloor(frame.width * 0.00000 + 0.5), y: frame.minY + fastFloor(frame.height * 0.14286 + 0.5), width: fastFloor(frame.width * 1.00000 + 0.5) - fastFloor(frame.width * 0.00000 + 0.5), height: fastFloor(frame.height * 0.92857 + 0.5) - fastFloor(frame.height * 0.14286 + 0.5))
