    public static func drawPoloniex(frame: NSRect = NSRect(x: 0, y: 0, width: 400, height: 28)) {
        //// General Declarations
        let context = NSGraphicsContext.current!.cgContext
        // This non-generic function dramatically improves compilation times of complex expressions.
        func fastFloor(_ x: CGFloat) -> CGFloat { return floor(x) }
        
        //// Color Declarations
        let black = NSColor(red: 0, green: 0, blue: 0, alpha: 1)
        let white = NSColor(red: 1, green: 1, blue: 1, alpha: 1)
        let highlightGradientColor = NSColor(red: 1, green: 1, blue: 1, alpha: 0.06)
        let highlightGradientColor2 = NSColor(red: 1, green: 1, blue: 1, alpha: 0)
        let poloniexBackground = NSColor(red: 0, green: 0.453, blue: 0.476, alpha: 1)
        
        //// Gradient Declarations
        let highlightGradient = NSGradient(starting: highlightGradientColor, ending: highlightGradientColor2)!
        
        //// Shadow Declarations
        let headerShadow = NSShadow()
        headerShadow.shadowColor = black.withAlphaComponent(0.12 * black.alphaComponent)
        headerShadow.shadowOffset = NSSize(width: 0, height: -1.5)
        headerShadow.shadowBlurRadius = 3
        let smallHeaderShadow = NSShadow()
        smallHeaderShadow.shadowColor = NSColor.black.withAlphaComponent(0.06)
        smallHeaderShadow.shadowOffset = NSSize(width: 0, height: -1)
        smallHeaderShadow.shadowBlurRadius = 1
        
        
        //// Subframes
        let group: NSRect = NSRect(x: frame.minX + fastFloor(frame.width * 0.00000 + 0.5), y: frame.minY + fastFloor(frame.height * 0.14286 + 0.5), width: fastFloor(frame.width * 1.00000 + 0.5) - fastFloor(frame.width * 0.00000 + 0.5), height: fastFloor(frame.height * 0.92857 + 0.5) - fastFloor(frame.height * 0.14286 + 0.5))
        let logo: NSRect = NSRect(x: frame.minX + fastFloor((frame.width - 54) * 0.50000 + 0.5), y: frame.minY + fastFloor((frame.height - 8.43) * 0.55290 - 0.32) + 0.82, width: 54, height: 8.43)
        
        
        //// Group
        NSGraphicsContext.saveGraphicsState()
        smallHeaderShadow.set()
        context.beginTransparencyLayer(auxiliaryInfo: nil)
        
        
        //// headerBase Drawing
        let headerBasePath = NSBezierPath()
        headerBasePath.move(to: NSPoint(x: group.minX + 0.00000 * group.width, y: group.minY + 0.50000 * group.height))
